import React from "react";

export default function Results(props) {
  if (props.definition.meanings) {
    return (
      <div className="Results">
        <section>
          <h2>{props.definition.word}</h2>
          <p>{props.definition.phonetic}</p>
        </section>
      </div>
    );
  } else {
    return null;
  }
}
